# -*- coding:utf-8 -*-

'''
Given a string, find the length of the longest substring without repeating characters.

Examples:

Given "abcabcbb", the answer is "abc", which the length is 3.

Given "bbbbb", the answer is "b", with the length of 1.

Given "pwwkew", the answer is "wke", with the length of 3. Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
'''

'''
    难度:中
    1.遍历字符串,找到当前所在字符加入到当前字符串变量
    2.遍历当前字符串后面的字符,判断下一个字符是否在当前字符串中,为假则将字符添加到当前字符串,计数+1
    3.否则退出二层循环,判断最大长度子字符串是否小于计数器,是则将计数器值赋值给max_len,清空计数器,遍历下一组

    注:在LeetCode上提交失败了,但是自我感觉是对的!!!
'''

class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        count = 0
        max_len = 0
        cur_s = ''
        for i in range(len(s)):
            count = 1
            cur_s = s[i]
            while i+count < len(s) and s[i+count] not in cur_s:
                cur_s += s[i + count]
                count = count+ 1
            if max_len < count:
                max_len = count
        return max_len

